import React from 'react'

export default function Navbar() {
  return (
    <nav>
      <ul>
        <li><h1>Ifa Brand</h1></li>
        <li><button>Work</button></li>
        <li><button>About</button></li>
        <li><button>Shop</button></li>
      </ul>
      <style jsx>{`
        * {
          font-family: 'Roboto', sans-serif;
        }

        ul {
          display: flex;
          padding: 0;
        }

        li {
          display:flex;
          list-style: none;
        }

        h1 {
          font-size: 30px;
          margin-right: 60px;
        }

        a {
          text-decoration: none;
          color: blue;
        }

        a:hover {
          opacity: 0.6;
        }
      `}</style>
    </nav>
  )
}
